import React from 'react';
import '../App.css';
import {Font} from "antd"

export const Head = () =>{
    return (
        <>
        <Div>
            <Font size = '50'><b>TodoMatic</b></Font>
        </Div>

        <Div>
            <Font size = '50'><b>What needs to be done?</b></Font>
        </Div>
        </>
    )
};
